INSERT INTO `comentarios` (`ID`, `ID_usuario`, `ID_pedido`, `calificacion`, `texto`) VALUES
(1, 9, NULL, 4, '¡Deliciosa comida! La variedad de platos es impresionante y la presentación es tentadora. El servicio es amable, aunque a veces un poco lento.'),
(2, 9, NULL, 3, 'Ambiente agradable, pero la comida puede ser inconsistente en sabor. El menú ofrece buenas opciones, pero esperaba un poco más en términos de calidad.'),
(3, 9, NULL, 5, '¡Experiencia culinaria excepcional! La comida es exquisita y el servicio es impecable. La ambientación del lugar hace que la cena sea aún más especial.'),
(4, 9, NULL, 2, 'Me decepcionó la calidad de la comida. El menú es limitado y los sabores no estuvieron a la altura de las expectativas. El servicio, sin embargo, fue amable.'),
(18, 2, 28, 5, 'Las pizzas han llegado calientes, estan buenisimas y su borde seguia crujiente'),
(24, 2, 33, 4, 'fds');
